import { Box, Flex, Heading, Select, Text, DatePicker } from "@chakra-ui/react";
import NavBar from "../../components/Navigasi";
import Footer from "../../components/Footer";


const Home = () => {
    
    return(
        <>
        <NavBar/>
            <Box bgColor={"#F5F7FA"} bgSize={"cover"} paddingTop={"100px"}>
                <Heading>Sales Information</Heading>

                <Flex padding={"30px"} gap={10}>
                    <Box width={"190px"}>
                        <Text marginBottom={"15px"}>Customer</Text>
                        <Select variant={"outline"}></Select>
                    </Box>

                    <Box width={"190px"}>
                        <Text marginBottom={"15px"}>Date</Text>
                        <DatePicker/>
                    </Box>
                </Flex>
            </Box>   
        <Footer/> 
        </>
    )
};

export default Home;
